import './styles/Header.css';
import {Route, Link, Routes } from 'react-router-dom';

function Header() {
    return (
      <>
        <div className="header">
          <Routes>
            {/* <Route href="/home"><img src={require('../assets/logo/csmarket.png')}/></Route>  */}
            <div className="topnav">
              <Link href="/Opencase">Opencase</Link>
              <Link href="/Upgrade">Upgrade</Link>
            </div>
            <Link href="/login" className="btn">Login via steam</Link>
          </Routes>
      </div>
      </>
      
    );
}

export default Header;
